import React from 'react';

function HouseMembers(props) {

    return (

        <div>
            {props.house.map(house => {

                const members = house.dwelling_members;

                return(
                    <React.Fragment>
                        <p>Members in your Household:</p>
                        <p>{members}</p>
                        <p>Your Household Super-User</p>
                    </React.Fragment>
                );
            })}
            </div>
    );
}

export default HouseMembers;
